            tips: "承点科技发布会 企业发布会",
            content: '<p> 　　摘要：2017年7月22日下午，北京承点科技有限公司在北大博雅国际酒店顺利召开了“革新·致远”主题发布会。</p><p><br></p><p>正文：</p><p>　　2017年7月22日下午，北京承点科技有限公司(chengdiankeji.com)在北大博雅国际酒店召开了“革新·致远”主题发布会。发布会当天，来自承点科技的部分领导、员工及合作伙伴共计500人出席了此次盛会。</p><p><br></p><p style="text-align: center;"><img src="news/details/760e5dbb0ba1855fa21f6bfe5c61f280.png" style="max-width:100%;"><br></p><p style="text-align: center;"><br></p><p> 　　在本次会议上，<a href="http://www.chengdiankeji.com" target="_blank"><u><b><font color="#f9963b">承点科技</font></b></u></a>与以下平台成功签署了战略合作协议。其中包括：中华杨氏联谊总会、京东企业购、杨氏商城、中承集团、九京会9mall商城、云图智联、梦无缺基金会。这标志着承点科技与多方渠道建立了良好牢固的战略合作关系。</p><p><br></p><p> 　　此次发布会更是一场商业文化大餐。承点科技创始人杨浩为大家分享了承点科技在服务中小企业转型升级领域的实践经验与探索成果；工业和信息化部软件与集成电路促进中心云计算研究中心主任杨东日博士为大家分析了传统企业在互联网经济中所处的形势；外国专家局专家谭萧锋博士以其多年在研究中小型企业转型升级的收获，为传统企业未来发展提供了指导性意见。发布会上，京东集团大客户市场部总监樊利峰为大家做了精彩演讲，在介绍京东与商会之间业务合作的同时，着重解答了企业如何在互联网模式下降低经营成本的问题，也是为承点科技未来发展之路做了方向指引。梦无缺控股集团一直致力于慈善事业，并且在助残事业之路有着新思想新高度，推动着中国残疾人事业的全面发展。梦无缺秉承着“消费即慈善，买卖共助残”的创新理念，引领资助特困残疾人事业新风向。石岩老师作为梦无缺的创始人应邀参加此次发布会，在会上石岩老师多次强调与承点科技的合作，并希望偕同承点科技一起将梦无缺慈善事业走入互联网。</p><p><br></p><p> 　　承点科技两年来一直为帮助传统中小企业转型升级做服务，在此次发布会上展示了全新的代运营模式--赔付机制，同样也是行业内首家提出愿意与传统企业在互联网之路上同盈亏共进退的企业。</p><p><br></p><p> 　　此次发布会获得多家媒体的关注，并对承点科技创始人杨浩进行了采访。杨浩表示，“发布会虽然结束，但对承点科技而言这更是一个新的开始，代运营行业未来需要大家共同努力缔造新篇章”。</p><p><br></p>',
