            tips: "承点科技，杨浩，中国财经峰会",
            content: '<p>　　承点科技CEO杨浩应邀参加2017年中国财经峰会（冬季论坛），并在会后接受媒体专访时表示承点科技会继续为帮助传统中小企业实现移动互联网转型而努力。</p><p><br></p><p> 　　2017年11月30日，以“进阶与蝶变”为主题的中国财经峰会（冬季论坛）在北京盛大举行，作为众多国内主流媒体联袂打造的年度财经思想盛会，峰会携手来自商界、学界、传媒以及文化艺术等领域的500余名嘉宾回顾过去，展望未来。承点科技凭借良好的公众综合评价与品牌影响力，在此次峰会评选中荣获年度最具成长性公司，CEO杨浩先生现场接受了媒体专访，以下是专访内容：</p><p><br></p><p> 　　主持人：首先恭喜我们的企业获得最具成长企业奖。您觉得我们企业是凭借什么获得组委会的认可？</p><p><br></p><p> 　　杨浩：因为<a href="http://www.chengdiankeji.com" target="_blank"><u><b><font color="#f9963b">承点科技</font></b></u></a>是一家创业公司，从2015年10月成立，到现在已经两年多了，凭借我们务实的在互联网行业踏踏实实、一步一步的走来，在同行业里边也有了一定的知名度，所以今天能坐在这里获得这个奖项。</p><p><br></p><p> 　　主持人：可以说是实至名归。咱们公司的主营业务能跟我们大家介绍一下吗？ </p><p><br></p><p>　　杨浩：承点科技的主营业务一共分成三块，技术、运营、传播推广。技术现在主要是以软件开发和APP开发为主；运营主要做电商运营、APP运营；传播就是全网的品牌推广，这是我们三块的主营业务。现在马上还要再接入另外一块，就是硬件，包括云，服务器安全这一块也会放在承点科技的技术板块之下，既有硬件和软件，又有运营和推广，整个主营业务就形成闭环。</p><p><br></p><p style="text-align: center;"><img src="news/details/fed3d97c38c1731eb1653de06b4ad05e.jpg" style="max-width:100%;"><br></p><p style="text-align: center;"><br></p><p> 　　主持人：那您觉得我们这样的业务对于传统企业以及创业者来说有什么样的影响或帮助？</p><p><br></p><p> 　　杨浩：承点科技为什么起名是承点，承是谦卑的托起的意思，点就是梦想和希望的种子。承点就是谦卑的托起梦想和希望的种子，让更多有想法、渴望成功的人得到结果。所以说承点科技的初心是帮助别人成功，再加上承点科技的技术、运营跟传播推广，这三块有利的支撑，传统企业不知道怎么做线上，既不懂技术也不懂运营，也没有渠道做推广，承点科技可以帮他解决这些问题。对于创业者，比如大学生他有一个很好的想法，没有技术做支撑，又没有运营能力，没有团队，没有传播的渠道，承点科技会帮助他去走向成功。承点科技的定位就是帮助传统企业、创业者实现你的移动互联网转型。</p><p><br></p><p> 　　主持人：可以说寓意非常好，那我们公司面临着最大的挑战是什么？ </p><p><br></p><p>　　 杨浩：我们做服务型的公司是属于轻资产，最大的挑战还是人才的挑战，我们公司需要更多有能力的人能认同承点科技，加入到承点科技，成为承点科技的一员，让承点科技越来越好。</p><p><br></p><p> 　　主持人：我们承点科技在今后的发展有什么样的战略方向吗？</p><p><br></p><p> 　　杨浩：我们定位承点科技是帮助别人成功。我已经用了两年去打基础，技术、运营跟传播打下基础，在未来的三年，我还要去夯实这三个部分。我说一下承点科技的合作模式，现在的合作模式是三种：</p><p>　　第一种服务费形式，我们帮他去做代运营，做推广。</p><p>　　第二种方式，少量的服务费+股份的形式，因为他的想法很好，但是他的资金又不是特别充裕的情况下，他现在又不懂技术，也不懂互联网，这样承点科技能给他做一个很好的支撑，就是服务费加股东的形式。</p><p>　　在未来，我们还有一个纯股份的形式，有一些大学生，他有很好的想法但技术薄弱又没有运营的能力，没有推广的渠道，他找到承点科技，他找到杨浩，我和我整个团队会对他这个项目做出评估，直接占你的股份就可以了。我做了一个计划，第一个五年我先用两年的时间打基础，在未来的三年，把我们的基础，把我们的服务做到更好的前提下，我计划是我们承点科技会在2020年，在创业板上去挂牌。</p><p><br></p><p> 　　主持人：感谢杨总为很多的有创业想法和创业潜质的年轻人托起他们想要创业的梦想。感谢杨总来到我们论坛的现场，谢谢。</p>',
