            tips: "淘宝规则 天猫规则 直通车规则",
            content: '<p>　　摘要：你知道吗，7月3日阿里妈妈发布了“【预通知】淘宝\\天猫直通车处罚变更”的公告，快来跟着<a href="http://www.chengdiankeji.com" target="_blank"><b><font color="#f9963b"><u>承点科技</u></font></b></a>一起来学习吧！</p><p><br></p><p>正文：</p><p>　　根据承点科技小编获得的最新资料，2017年7月3日阿里妈妈规则中心发布了一则名为“【预通知】淘宝\\天猫直通车处罚变更”的公告，公告内容如下：</p><p><br></p><p style="text-align: center;"><img src="news/details/d39734261c691af74b53a9309b2e7089.jpg" style="max-width:100%;"><br></p><p> 　　</p><p>　　首先我们先来说说淘宝直通车！百度百科上说：淘宝直通车是为专职淘宝卖家量身定制的，按点击付费的效果营销工具，为卖家实现宝贝的精准推广。它是由阿里巴巴集团下的雅虎中国和淘宝网进行资源整合，推出的一种全新的搜索竞价模式。</p><p><br></p><p>　　换句话就是说，使用淘宝直通车推广，用一个点击，就能让买家进入你的店铺，产生一次甚至多次的店铺内跳转流量，这种以点带面的关联效应可以降低整体推广的成本和提高整店的关联营销效果。同时，淘宝直通车还给用户提供了淘宝首页热卖单品活动和各个频道的热卖单品活动以及不定期的淘宝各类资源整合的直通车用户专享活动。</p><p><br></p><p>　　说了这么多淘宝直通车的作用，我们继续来解读这个公告吧。</p><p><br></p><p>　　通过仔细观察这个公告，我们可以发现此规范的执行时间是从2017年7月4日开始的。所以如果你还不太了解这个规则的话，就快来跟我们看看吧。承点科技在阿里妈妈规则中心上了一堂有关直通车规则变更的课程，现在就把其中需要值得注意的点分享给大家！快拿出小本本记好了！</p><p><br></p><p>　　<b>第一条、类目准入要求（保持不变）</b></p><p> 　　商品在进行推广的时候，不同的类目有不同的要求，例如：</p><p> 　　1、成人用品，家庭保健，二手闲置等类目是平台禁止的；</p><p> 　　2、医疗及健康服务、保健品等类目则需要相关的类目准入资质。</p><p style="text-align: center;"><img src="news/details/b28f834717d649099d7478d6fb19fa66.jpg" style="max-width:100%;"><br></p><p><b>　　第二条、违规分类及内容调整变更：</b></p><p><b><br></b></p><p>\n 　　本次变更的规则主要如下2点： </p><p> 　　1、 违规类型内容调整。违规名称由一类、二类、三类违规调整为A类、B类、C类违规。A类、B类、C类违规对应的内容调整新增。 </p><p> 　　2、 A类、B类、C类违规对应的扣分分值以及处罚措施调整新增。\n<br>\n<br> 　　来看一下直通车和钻展的变化有哪些？\n<br>\n<br> 　　1、直通车推广规则：\n<br>\n</p><p style="text-align: center;"><img src="news/details/c00399d9506fc15594470578af4d9218.jpg" style="max-width:100%;"><br></p><p style="text-align: center;"><img src="news/details/68be97c91e78c81815777462398eeaf4.jpg" style="max-width:100%;"><br></p><p><br></p><p> 　　2、钻展推广规则：</p><p style="text-align: center;"> 　<img src="news/details/885586d651f805c11c993c52bf4f9c20.jpg" style="max-width: 100%;"></p><p style="text-align: center;"><img src="news/details/5148e3c8b9b89ccf6e82b0cba44486d1.jpg" style="max-width:100%;"><br></p><p><b>　　</b><a href="http://www.chengdiankeji.com" target="_blank"><b><font color="#f9963b">承点科技</font></b></a><b>(www.chengdiankeji.com)提示：以上的调整之外，卖家们需要需要重点了解以下两点：</b></p><p> 　　1、如果店铺A类违规达到36分，被永久清退； </p><p>　　2、创意在审核的时被拒绝，就有可能被扣分；</p><p> 　　所以，卖家切勿大意，需要及时了解推广最新的规则，规避违规的风险，你可以随时登录我们的网站来进行了解。承点科技，帮助企业顺利完成互联网转型，为您提供专业的电商代运营，淘宝代运营，天猫代运营，京东代运营，全网整合营销，应用技术开发，O2O运营平台管理，微分销系统等一站式电商服务。 做电商，就找承点科技！</p>',
