            title: "常用的淘宝标题优化分词的技巧",
            pic: "/public/images/news/4a8f79c66cbf7083e305961d47e9aa2e.png",
            summary: "淘宝代运营  分词技巧",
            tips: "淘宝代运营必懂的淘宝标题优化分词的技巧",
            content: '<p>　　对于想把淘宝宝贝做出排名的<a href="http://www.chengdiankeji.com" target="_blank"><b><u><font color="#f9963b">淘宝代运营</font></u></b></a>来说，一定要知道常用的淘宝标题优化的技巧。而通常我们说的优化标题就不可避免的会涉及到为标题分词，接下来就跟着承点科技一起来看看必懂的淘宝标题优化分词的技巧吧！ </p><p><br></p><p>　　<b>一、分词原则\n</b><br>　　说到分词，可不是简简单单的把一个宝贝标题拆成一个个的汉字，而是淘宝系统将标题里的关键词拆分成单个的字或词组。但是重点说明一下，具备特定含义和特指的词不能用空格分开的，比如情侣，就绝对不能拆分为“情(空格)侣”。因为这样搜索出来的结果可是会和搜索“情侣”能搜出不同的内容哦。 </p><p><br></p><p style="text-align: center;"><img src="news/details/ab94b45807cf3135c94c70545b789d77.png" style="max-width:100%;"><br></p><p style="text-align: center;"><br></p><p>　<b>　二、不可拆分词和可拆分词\n</b><br>　　另外一些广泛含义的词是可拆分的，如：情侣沙滩鞋，可以拆分成为情侣/沙滩鞋。但是如果是宝贝名称词、属性词这类的词的话，则是不可以拆分的，所以我们在组合标题时候要注意，比如韩版连衣裙，我们不要故意去用空格拆分为韩/版/连衣/裙，而是可以拆分成韩版/连衣裙。 </p><p><br>　　<b>三、标题空格是否会影响搜索？\n</b><br>　　标题空格会不会影响到搜索结果，其实这一点说到底就是要看我们在空格的时候会不会引起分词混乱，因为不同的空格，出现的搜索意思会不一样，所以会有一定的影响的哦。有时候有空格和没空格有时候搜索结果会不一样，这是因为系统拆分的时候结果不同和买家搜索习惯的不同引起的。比如：小甘菊花，系统自动拆分为：小/甘菊/花。 如果把在标题这么设置：小甘(空格)菊花，那系统会拆分为：小/甘/菊花。搜索时返回结果是不一样的 。</p><p> \n<br>　　说了这么多你应该明白了淘宝标题优化分词中的几个技巧了吧，那接下来就赶紧去看看你的标题是否符合我们的分词原则吧。更多更好的<a href="http://www.chengdiankeji.com" target="_blank"><b><u><font color="#f9963b">淘宝代运营</font></u></b></a>知识尽在承点科技官方网站，请敬关注！</p>',
